import React from "react";

export default function TableOfPromises({ joinablePromises }) {
  async function producePromises() {
    if (joinablePromises) {
      return joinablePromises.map((promise) => {
        <tr>
          <td>{promise._amountA}</td>
          <td>{promise._assetA}</td>
          <td>{promise._amountB}</td>
          <td>{promise._assetB}</td>
          <td>{promise._time}</td>
        </tr>;
      });
    } else {
      return <p></p>;
    }
  }
  return (
    <div>
      <p>Promises you can join</p>
      <table>
        <th>ID</th>
        <th>Asset A</th>
        <th>Amount A</th>
        <th>Asset B</th>
        <th>Amount B</th>
        {producePromises()}
      </table>
    </div>
  );
}
